import React from 'react';
import httpClients from '../httpClients';

const RegisterPage = () => {

    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [name, setName] = useState("");
    const [lastName, setLastName] = useState("");


    const registerUser = async () => {
        const created_user = await httpClients.post("//localhost:5000/registro", {
            email,
            password,
            name,
            lastName
        })
        const resp = await httpClients.post("//localhost:5000/login", {
            email,
            password,
        })

    };



    return (
        <form className="ui form">
            <div className="field">
                <label>First Name</label>
                <input onClick={() => setName(e.target.value)} value={name} type="text" name="first-name" placeholder="First Name"/>
            </div>
            <div className="field">
                <label>Last Name</label>
                <input onClick={() => setLastName(e.target.value)} value={lastName} type="text" name="last-name" placeholder="Last Name"/>
            </div>
            <div className="field">
                <label>Email</label>
                <input onClick={() => setEmail(e.target.value)} value={email} type="text" name="last-name" placeholder="Last Name"/>
            </div>
            <div className="field">
                <label>Contrase√±a</label>
                <input onClick={() => setPassword(e.target.value)} value={password} type="text" name="last-name" placeholder="Last Name"/>
            </div>

            <button onClick={() => registerUser()} className="ui button" type="submit">Registrarse</button>
        </form>
    )
}

export default RegisterPage;
